			    elsif(cntr59 mod 60 = 6) then	
			    	  bmbit:= BM_6(vpos1)(hpos1);
			    elsif(cntr59 mod 60 = 7) then	
			    	  bmbit:= BM_7(vpos1)(hpos1);
			    elsif(cntr59 mod 60 = 8) then	
			    	  bmbit:= BM_8(vpos1)(hpos1);
			    elsif(cntr59 mod 60 = 9) then	
